import './css/App.css';
import logo_twitter from './img/twitter.jpg' // relative path to image
const axios = require(axios);

function App() {
  const request = function(){
    return axios.get(`https://api.twitter.com/2/tweets`,{ params: { header: "authorization: Bearer $AAAAAAAAAAAAAAAAAAAAAMrVIwEAAAAAIzz71ZCU5cAtvPDMmFpOK0gWhDE%3DK1yPC7sVQGGs6xgYh0xnaWGKaFbljoaYmEqj6iaxVQyVRaxsQs"}})
            .catch((error) => console.log(error));
    
  }

  console.log(request());

  return (
    <div className="App">
      <header className="App-header">
        <img src={logo_twitter} className="App-logo"/>
        <p>
          Twitter Tracker
        </p>
      </header>
    </div>
  );
}

export default App;
